import React from "react";
import Wrapper from "./components/Wrapper";
import Title from "./components/Title";
import SpongeBobCard from "./components/Friendcard";
import SquidwardCard from "./components/Friendcard";
import MrKrabsCard from "./components/MrKrabsCard";
import Friends from "friends.json";

function App() {
  return (
    <Wrapper>
      <Title>Friends List</Title>
      <FriendsCard 
        name={friends[0].name}
        image={friends[0].image}
        occupation={friends[0].occupation}
        loction= {friends[0].location}
      />
      <FriendsCard 
        name={friends[1].name}
        image={friends[1].image}
        occupation={friends[1].occupation}
        loction= {friends[1].location}
      />
      <FriendsCard 
        name={friends[2].name}
        image={friends[2].image}
        occupation={friends[2].occupation}
        loction= {friends[2].location}
      />
    </Wrapper>
  );
}

export default App;
